import * as React from 'react';
import Header from '../../header/Header';

const Home = () => {
    return(
        <div>
            <Header />
            This is the home page
            <a href="/profile">Go to profile</a>
            <a href="/budget">Go to budget</a>
        </div>
    )
}

export default Home;
